import React from 'react';
import C from './Messages.module.css'
import { NavLink } from 'react-router-dom';

const DialogItem = (props) => {
    let path = "/messages/" + props.id
    return (
        <div className={C.userItem}>
            <NavLink to={path}>{props.name}</NavLink>
        </div>
    )
}
const MessageItem = (props) => {
    return (
        <div className={C.messageItem}>{props.message}</div>
    )
}
const Messages = (props) => {

    let usersData = [
        { id: 1, name: 'John' },
        { id: 2, name: 'Jesus' },
        { id: 3, name: 'Jacob' },
        { id: 4, name: 'Jessica' },
        { id: 5, name: 'Jane' },
    ]
let userElem = usersData.map( (dialog)=> <DialogItem name={dialog.name} id={dialog.id} />);


    let messageData = [
        { id: 1, message: 'Huylow' },
        { id: 2, message: 'Я хожу по воде' }, 
        { id: 3, message: 'Жакоб или Якоб?' },
        { id: 4, message: 'Альба?' },
        { id: 5, message: 'Fuck' },
    ]

let messageElem = messageData.map( (message)=> <MessageItem message={message.message}/>);

    return (
        <article className={C.article}>
            <div className={C.users}>
                {userElem}
                {/* [<DialogItem name={usersData[0].name} id={usersData[0].id} />,
                <DialogItem name={usersData[1].name} id={usersData[1].id} />,
                <DialogItem name={usersData[2].name} id={usersData[2].id} />] */}
                {/* <DialogItem name="Jessica" id="4" />
                <DialogItem name="Jane" id="5" /> */}
            </div>
            <div className={C.messages}>
                {messageElem}
                {/* <MessageItem message={messageData[0].message} />
                <MessageItem message={messageData[1].message} />
                <MessageItem message={messageData[2].message} /> */}
            </div>
        </article>
    )
}

export default Messages;
